/* eslint-disable no-unused-expressions */
/* eslint-disable no-unused-vars */
import useGetSeller from "../hooks/UseGetSeller";
import { React, useEffect, useState } from "react";
// import { useTheme } from "@mui/material/styles";
import { Button, Paper } from "@mui/material";
import DataTable from "react-data-table-component";

export default function SellerListTable({ idcliente, oculto, setoculto }) {
  const { data } = useGetSeller({ idcliente });
  const datafinal = data[0];

  //console.log("pico del data", datafinal)

  const [botoncito, setbotoncito] = useState({
    activo: true,
  });

  useEffect(() => {
    setbotoncito(datafinal);
  }, [botoncito, datafinal]);

  console.log("botonncito", botoncito);

  const columnas = [
    {
      name: "Seller Name",
      selector: (row) => row.legalname,
    },
    {
      name: "Dirección",
      selector: (row) =>
        row.legaladdress.numero +
        " " +
        row.legaladdress.calle +
        " " +
        row.legaladdress.barrio,
    },
    {
      name: "Ciudad, Estado",
      selector: (row) =>
        row.legaladdress.ciudad + " , " + row.legaladdress.estado,
    },
    {
      name: "Zip Code",
      selector: (row) => row.legaladdress.zip,
    },
    {
      name: "Pais",
      selector: (row) => row.legaladdress.pais,
    },

    {
      name: "Telefono",
      selector: (row) => "+52" + row.telefono,
    },
  ];

  const nuevoseller = () => {
    setoculto({
      ...oculto,
      hiddentable: false,
      hiddenboton: true,
      hiddenperfilform: true,
      hiddenupdate: false,
    });
  };

  const volver = () => {
    setoculto({
      ...oculto,
      hiddentable: true,
      hiddenboton: true,
      hiddenperfilform: false,
      hiddenupdate: false,
    });
  };

  const editar = () => {
    setoculto({
      ...oculto,
      hiddentable: false,
      hiddenboton: true,
      hiddenperfilform: false,
      hiddenupdate: true,
    });
  };

  return (
    <>
      {botoncito ? <Button onClick={editar}>Editar Perfil</Button> : null}
      {botoncito ? null : (
        <Button
          size="small"
          variant="contained"
          color="secondary"
          onClick={nuevoseller}
        >
          Configurar Perfil
        </Button> 
      )}<br></br>
      {oculto.hiddenboton ? <Button>Volver</Button> : null}

      <DataTable striped columns={columnas} data={data} />
    </>
  );
}
